import "./App.css";

import React, { version, useState } from "react";

import Button from "@mui/material/Button";

import { FormControl, InputLabel, Select, MenuItem } from "@mui/material";

function App() {
  const titleDiv = () => {
    console.log(version);
    return (
      <div className="titleDiv">
        <h1> Camera API WebApp</h1>
      </div>
    );
  };

  const deviceMenu = () => {
    return (
      <div className="deviceMenuContainer">
        <div className="deviceMenuDropdown">
          <FormControl fullWidth>
            <InputLabel id="demo-simple-select-label">SELECT DEVICE</InputLabel>
            <Select
              labelId="demo-simple-select-label"
              id="demo-simple-select"
              value={0}
              label="SELECT DEVICES"
              onChange={() => {}}
            >
              <MenuItem value={1}>device 1</MenuItem>
              <MenuItem value={2}>device 2</MenuItem>
              <MenuItem value={3}>device 3</MenuItem>
            </Select>
          </FormControl>
        </div>
        <div className="selectedDevice">
          <p>Selected Device</p>
          <div> device 2</div>
        </div>
      </div>
    );
  };

  const controlsBar = () => {
    return (
      <>
        <div className="controlsBar">
          <div>
            <Button variant="contained" size="small" color="secondary">
              Start Recording
            </Button>
          </div>
        </div>
      </>
    );
  };
  return (
    <div className="App">
      {titleDiv()}
      {deviceMenu()}
      {controlsBar()}
    </div>
  );
}

export default App;
